        "Wert": " Erwerbskosten",
        "Erklärung": "http://www.steuernetz.de/aav_steuernetz/lexikon/K-12381.xhtml?currentModule=steuernWas zählt alles zu den Anschaffungskosten?Als Käufer erwerben Sie aufgrund eines beim Notar abgeschlossenen Kaufvertrages (oder gleichstehenden Rechtsaktes wie z.B. Meistgebot im Zwangsversteigerungsverfahren) von einem Dritten ein Haus oder eine Eigentumswohnung gegen Zahlung eines Kaufpreises. Das sind Ihre Anschaffungskosten, auch wenn dieser Dritte das Haus oder die Wohnung noch bauen muss (etwa beim Kauf vom Bauträger, bei dem Gegenstand des Kaufvertrages das fertiggestellte Gebäude ist).Zu den Anschaffungskosten gehören auch die Anschaffungsnebenkosten. Das sind alle Aufwendungen, die im Zusammenhang mit dem Abschluss des Kaufvertrages und dem Eigentümerwechsel stehen. Sie werden dem Kaufpreis hinzugerechnet und mit abgeschrieben, soweit sie auf das Gebäude entfallen. Anschaffungsnebenkosten beim Kauf eines Altbaus oder Neubaus sind insbesondere die Notarkosten (nur für die Beurkundung des Kaufvertrages und evtl. für die Verwaltung des Notaranderkontos), Grunderwerbsteuer, Gebühren des Grundbuchamtes (nur für Eigentümerwechsel einschließlich evtl. Gebühren für Auflassungsvormerkung), Maklergebühren (nur für die Vermittlung des Objekts), Fahrt- und Telefonkosten (nur im Zusammenhang mit dem erworbenen Objekt), Schätz- und Gutachterkosten sowie Gerichtskosten bei Erwerb im Zwangsversteigerungsverfahren.Nicht unmittelbar mit dem Objekt zusammenhängende Nebenkosten, wie z.B. Notarkosten für die Eintragung der Grundschuld bei Fremdfinanzierung, sind sofort abziehbare Werbungskosten.Für die Abschreibung müssen die gesamten Anschaffungskosten (inkl. der Anschaffungsnebenkosten) aufgeteilt werden in Anschaffungskosten des Grund und Bodens und Anschaffungskosten des Gebäudes. Die Anschaffungskosten für den Grund und Boden sind mangels Abnutzung nicht abschreibbar und müssen deshalb von den gesamten Anschaffungskosten abgezogen werden. Vom verbleibenden Betrag ist die jährliche Gebäudeabschreibung zu berechnen.https://www.steuern.de/steuererklaerung-anlage-v.html[Absetzung für Abnutzung (AfA)/Abschreibung → Zeilen 33–35]Die Zeilen sind für die Absetzung für Abnutzung (AfA) vorgesehen, die sich aus den AK bzw. HK des Gebäudes und seiner Nutzungsdauer ermittelt. Soweit Sie erstmals AfA geltend machen, müssen Sie eine Aufstellung der entstandenen AK oder HK (Art und Betrag) sowie die von Ihnen vorgenommene AfA-Berechnung auf einem gesonderten Blatt beifügen. Das Finanzamt wird in vielen Fällen auf die Vorlage der Einzelbelege (Bauordner) verzichten.",
