        "Wert": "Geldbeschaffung",
        "Erklärung": "Geldbeschaffungskostenhttp://www.steuernetz.de/aav_steuernetz/lexikon/K-12207.xhtml?currentModule=steuernFinanzierungskosten (Geldbeschaffungskosten)Finanzierungskosten sind als Werbungskosten sofort abziehbar, wenn Sie das erhaltene Fremdkapital unmittelbar für Ihr vermietetes Objekt verwenden. Zu den sofort abziehbaren Kosten zählen die Abschlussgebühr für einen →Bausparvertrag, alle → Schuldzinsen und das → Damnum (Disagio), Aufwendungen für Fachliteratur über Finanzierungsmöglichkeiten, alle → Fahrtkosten im Zusammenhang mit der Finanzierung, die Kosten für die Erstellung eines computergestützten Finanzierungsplans, die Kosten für Fotokopien (zum Beispiel für die Beleihungsunterlagen), alle Gebühren der Banken oder (Bau-)Sparkassen für die Darlehensvergabe, die → Grundbuchgebühren für die Eintragung des Baudarlehens, die → Maklergebühren für die Vermittlung eines Baudarlehens, die → Notarkosten für die Eintragung einer Hypothek oder Grundschuld, die Portokosten zum Beispiel für die Korrespondenz mit der Bank, alle → Telefonkosten im Zusammenhang mit der Finanzierung, unter bestimmten Voraussetzungen eine → Vorfälligkeitsentschädigung und →Gutachterkosten.",
