        "oid": "16",
        "Wert": "Werbungskosten",
        "Erklärung": "https://www.steuern.de/steuererklaerung-anlage-v.html[Weitere Werbungskosten → Zeilen 46, 47 und 49]Im Vordruck sind einige typische Aufwendungen aufgeführt. Die Kosten für Heizung und Warmwasser, Müllabfuhr und andere Umlagen können Sie geltend machen, wenn Sie die von den Mietern dafür bezahlten Beträge in den Einnahmen (Vorderseite Zeilen 13, 14) erfasst haben. Zu den Hausversicherungen (Zeile 46) gehören neben der Gebäudehaftpflicht auch die Gebäudebrand- und Elementarschadenversicherung, eine Glasbruch- und die Leitungswasserschadenversicherung. Verwaltungskosten (Zeile 47) sind insbesondere Zahlungen an den Hausverwalter sowie Hausgelder.  Zu «Sonstiges» (Zeile 49) gehören z. B. Mitgliedsbeiträge zum Haus- und Grundbesitzerverein, Kosten für die Mietersuche (Makler, Zeitungsanzeigen) oder der Einziehung der Miete (Anwalts-, Mahn-, Gerichtskosten), Kontoführungsgebühren (pauschal 16 EUR), Reisekosten (Fahrtkosten, Verpflegungsmehraufwendungen und Übernachtungskosten im Zusammenhang mit Reparaturen, Behördengängen, Handwerkerbesprechungen oder Grundstückskontrollen) sowie Telefongespräche mit den Mietern und Steuerberatungskosten im Zusammenhang mit dem vermieteten Objekt. Denken Sie auch an die Kosten für z. B. Rasenmäher, Mülltonnen oder Gartengeräte, die Sie zur Nutzung durch die Mieter gekauft haben.Heizungsanlage: http://www.steuernetz.de/aav_steuernetz/lexikon/K-12207.xhtml?currentModule=home",
